import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


const user = {
    username: 'Testik',
    imageUrl:
    'https://img.artguru-cdn.com/image/aigc/17c700a69fbb502219ac6f4231391323_1024_1024.webp',
    imageSize: 250,
    name: 'Тест',
    last_name: 'Тестовый',
    gender: 0,
    city: 'Москва',
}


function App() {
  return (
    <div className="App">
       <Profile/>
    </div>
  );
}

function Profile()
{
    return (
    <div className="profile">
    <h1>{user.name}</h1>
    <img
        src={user.imageUrl}
        alt={'Photo by ' + user.name}
        style = {{
            width: user.imageSize,
            height: user.imageSize
        }}
        />
    </div>
    );
}

export default App;
